import Col from 'react-bootstrap/Col';
import './index.css';

const app =
    <Container>
        {/* Header */}
        <Row><h1>Alarm Dashboard</h1></Row>
        {/* Main Content */}
        <Row>
            <Col xs={5}>1</Col>
            <Col xs={7}>2</Col>
        </Row>
    </Container>


ReactDOM.render(app, document.getElementById("root"));
